window.bookSummaryJSON = "<p><b>2021 SOVAS Award Finalist for Audiobook Narration—Short Story Anthology—Best Voiceover</b></p> <p>Behind a wall of amnesia, he can’t remember anything. Maybe he can’t bear to. Nameless knows only the mission: Directed by the mysterious Ace of Diamonds, he travels the country, turning predators into prey. But the pain in his past can’t hold him back when dark visions of the future lead him toward his greatest test yet. Nameless is closing in on a revelatory endgame in this collection of short thrillers from #1 <i>New York Times</i> bestselling author Dean Koontz.</p> <p><b><i>The Lost Soul of the City</i></b></p> <p>A gun. A mission. No memories. Nameless is back to hunt down an architect of chaos in #1 <i>New York Times</i> bestselling author Dean Koontz’s return to a landscape of hard-won justice.</p> <p><b><i>Gentle Is the Angel of Death</i></b></p> <p>To some he’s a medical genius. To others, a twisted angel of mercy with a necessary solution to what he sees as an ugly dilemma. Only one man can help Dr. Death face the evil of his ways.</p> <p><b><i>Kaleidoscope</i></b></p> <p>Nameless is wrestling with more violent visions of the future when his next mission comes with the assurance, <i>This one will be easy</i>. It’s a promise that leaves Nameless dangerously unprepared.</p> <p><b><i>Light Has Weight, but Darkness Does Not</i></b></p> <p>Instinct and violent visions compel Nameless to embark on an unplanned mission to help a desperate mother and daughter on the run. Why is this rescue so strangely familiar to a man with no memories?</p> <p><b><i>Corkscrew</i></b></p> <p>A terrorist attack in the news leaves Nameless reeling from a disturbing vision. But it’s not a glimpse of the future. It’s a recovered memory that’s opening a window into his mysterious past.</p> <p><b><i>Zero In</i></b></p> <p>This could be the most important mission of Nameless’s life. Because it’s putting him on a collision course with his own past and the nation’s future.</p>"; 
